<script>
    function addroom() {
        var hosteldetailsid = $('#Hostelroom_hosteldetailsid option:selected').val();
        var room = $('#Hostelroom_hostelroom_roomno').val();
        var noofbeds = $('#Hostelroom_hostelroom_noofbeds').val();
        var rent = $('#Hostelroom_hostelroom_rent').val();

        $('#roomdisplay tbody').append('&lt;tr&gt;&lt;td data-id="' + hosteldetailsid + '"&gt;' + room + '&lt;/td&gt;&lt;td&gt;' + noofbeds + '&lt;/td&gt;&lt;td&gt;' + rent + '&lt;/td&gt;&lt;td&gt;&lt;a href="#"&gt;&lt;img src="/images/delete.png"&gt;&lt;/a&gt;&lt;/td&gt;&lt;/tr&gt;');

    }
    $(function () {
        $('#roomdisplay').on('click', 'tr a', function (e) {
            e.preventDefault();
            $(this).parents('tr').remove();
        });
    });
    function save() {
        var roomdetails = [];

        var hosteltypeid = $('#Hostelroom_hosteltypeid option:selected').val();
        var hosteldetailsid = $('#Hostelroom_hosteldetailsid option:selected').val();
        var floorname = $('#Hostelroom_hostelroom_floorname').val();
        var feestype = $('#Hostelroom_feestype option:selected').val();

        var startdate1 = $('#Hostelroom_startdate1').val();

        $('#roomdisplay tbody tr').each(function (row, tr) {

            roomdetails.push($(tr).find('td:eq(0)').text());
            roomdetails.push($(tr).find('td:eq(1)').text());
            roomdetails.push($(tr).find('td:eq(2)').text());

        });
        $.ajax({
            type: "POST",
            url: "savehostelroom",
            data: {roomdetails: JSON.stringify(roomdetails), hosteltypeid: hosteltypeid, hosteldetailsid: hosteldetailsid, floorname: floorname, feestype: feestype,
                startdate1: startdate1, duedate1: $('#Hostelroom_duedate1').val(), enddate1: $('#Hostelroom_enddate1').val(),
                startdate2: $('#Hostelroom_startdate2').val(), duedate2: $('#Hostelroom_duedate2').val(), enddate2: $('#Hostelroom_enddate2').val(),
                startdate3: $('#Hostelroom_startdate3').val(), duedate3: $('#Hostelroom_duedate3').val(), enddate3: $('#Hostelroom_enddate3').val(),
                startdate4: $('#Hostelroom_startdate4').val(), duedate4: $('#Hostelroom_duedate4').val(), enddate4: $('#Hostelroom_enddate4').val(),
                startdate5: $('#Hostelroom_startdate5').val(), duedate5: $('#Hostelroom_duedate5').val(), enddate5: $('#Hostelroom_enddate5').val(),
                startdate6: $('#Hostelroom_startdate6').val(), duedate6: $('#Hostelroom_duedate6').val(), enddate6: $('#Hostelroom_enddate6').val(),
                startdate7: $('#Hostelroom_startdate7').val(), duedate7: $('#Hostelroom_duedate7').val(), enddate7: $('#Hostelroom_enddate7').val(),
                startdate8: $('#Hostelroom_startdate8').val(), duedate8: $('#Hostelroom_duedate8').val(), enddate8: $('#Hostelroom_enddate8').val(),
                startdate9: $('#Hostelroom_startdate9').val(), duedate9: $('#Hostelroom_duedate9').val(), enddate9: $('#Hostelroom_enddate9').val(),
                startdate10: $('#Hostelroom_startdate10').val(), duedate10: $('#Hostelroom_duedate10').val(), enddate10: $('#Hostelroom_enddate10').val(),
                startdate11: $('#Hostelroom_startdate11').val(), duedate11: $('#Hostelroom_duedate11').val(), enddate11: $('#Hostelroom_enddate11').val(),
                startdate12: $('#Hostelroom_startdate12').val(), duedate12: $('#Hostelroom_duedate12').val(), enddate12: $('#Hostelroom_enddate12').val()},
            dataType: "html",
            success: function (data) {
                alert("Success.");
                location.reload();
            }
        });
    }
    $(document).ready(function () {
        var droplist = $('#Hostelroom_feestype');
        droplist.change(function () {
            if (droplist.val() === '1') { //annual

                $("#Monthly").hide("slow");
                $("#Quarterly").hide("slow");
                $("#Bi-Annual").hide("slow");
                $("#Annual").show("slow");
                $("#datelist").show("slow");
            }
            if (droplist.val() === '2') {   //bi-annual

                $("#Monthly").hide("slow");
                $("#Quarterly").hide("slow");
                $("#Annual").show("slow");
                $("#Bi-Annual").show("slow");
                $("#datelist").show("slow");
            }
            if (droplist.val() === '4') {  //quarterly

                $("#Monthly").hide("slow");
                $("#Quarterly").show("slow");
                $("#Annual").show("slow");
                $("#Bi-Annual").show("slow");
                $("#datelist").show("slow");
            }
            if (droplist.val() === '5') {  //monthly

